import React, { Component } from 'react'
import './Tag.css'

class Tag extends Component {

    render() {
        return (
            <div className="tags">
                {this.props.tags.map((tag) => {
                    const name = " " + tag.name
                    return (
                        <a href={"/tags/" + tag.id} key={tag.id}>
                            {name}
                        </a>
                    );
                })}
            </div>
        )
    }
}

export default Tag
